[FIELD]
Field(1).NAME="Datestamp"
Field(1).TYPE="DateTime"
Field(1).FORMAT="yyyy/M/d h:mm"

Field(2).NAME="SolarGeneration"
Field(2).TYPE="Number"

[MSG]
MSG(1).NAME="Header"
MSG(2).NAME="Data"

[Header]
Header.FILTER=C1=="DATE*"

[Data]
Data.FILTER=C1=="20*"

Datestamp=["(*),*"]
SolarGeneration=["*,*,*,*,*,*,*,(*),*"]

StoreEvent("Japan.Kyushu.Solar Generation", ,Datestamp,SolarGeneration)